import React from "react";
import "./App.css";

function App() {
  return (
    <nav className="navbar">
      <div >
        fiverr<span style={{ color: "green" }}>.</span>
      </div>
      <ul className="menu">
        <li>Business solutions </li>
        <li>Explore </li>
        <li>English </li>
        <li>Become a Seller </li>
        <li>Sign in </li>
      </ul>
        <button>Join</button>
    </nav>
  );
}

export default App;
